int maxFrequency(vector<int>& nums, int k) {
    int totalOp = k;
    int len = nums.size();
    sort( nums.begin(), nums.end() );
    cout<<"sorted"<<endl;
    int l_idx = len-2;
    int r_idx = len-1;
    int max_frequency = 0;

    long long int sub_arr_total = nums[l_idx]+nums[r_idx];

    while(l_idx>=0){

        long int sub_arr_len = r_idx - l_idx + 1;
        long long int max_arr_total = nums[r_idx] * sub_arr_len;
        
        for(int i=l_idx; i<=r_idx; i++){
            sub_arr_total+=nums[i];
        }

        long long int requiredOp = max_arr_total - sub_arr_total;

        if(requiredOp <= totalOp){
            max_frequency = max_frequency > sub_arr_len? max_frequency : sub_arr_len;
            if(l_idx!=0){
                sub_arr_total+=nums[l_idx];
            }
            l_idx--;
        }else{
            sub_arr_total-=nums[r_idx];
            r_idx--;
        }
    }
    return max_frequency;
}

